type TodoType = {
  userId: number;
  title: string;
  completed: boolean;
}

export const Todo = (props: TodoType) => {
  const { title, userId, completed } = props;
  const completeMark = completed ? "[完]" : "[未]";
  return <p>{`${completed} ${title}(ユーザー:${userId})`}</p>;
};
